import axios from "axios";

const SIGNUP = "SIGNUP";

export const signup = (data) => ({
  type: SIGNUP,
  data: data,
});

const initialState = {
  isLoggedIn: false,
  myInfo: null,
};

export default function reducer(state = initialState, action) {
  switch (action.type) {
    case SIGNUP:
      return {
        ...state,
        signupSuccess: action.payload,
      };
    default:
      return state;
  }
}
